import App from "./app";

function Home() {
  return (
    <App>
      <div className="banner">
        <div className="banner-content">
          <h3>Banner subheading</h3>
          <h2>Banner heading</h2>
          <p>This is banner description</p>
        </div>
      </div>
      <main></main>
    </App>
  );
}

export default Home;
